CREATE TABLE simpatizante_ine (
    simpine_id INT PRIMARY KEY AUTO_INCREMENT,
    simpine_nombre VARCHAR(50) DEFAULT 'DEFAULT',
    simpine_apaterno VARCHAR(50) DEFAULT 'DEFAULT',
    simpine_amaterno VARCHAR(50) DEFAULT 'DEFAULT',
    simpine_localidad VARCHAR(255) DEFAULT 'DEFAULT',
    simpine_seccion VARCHAR(50) DEFAULT '000',
    simpine_direccion TEXT,
    simpine_cp VARCHAR(50) DEFAULT '00000',
    simpine_tel_celular VARCHAR(255) DEFAULT '0000000000',
    simpine_comentario VARCHAR(500) DEFAULT 'DEFAULT',
    simpine_visible TINYINT(1) DEFAULT 0,
    simpine_fecha_movimiento VARCHAR(50) DEFAULT 'DEFAULT',
    simpine_motivo_movimiento TEXT NOT NULL,
    simpine_fk_directivo INT,
    simpine_fk_lider INT,
    simpine_fk_coordinador INT,
    simpine_fk_usuario_movimiento INT
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;

CREATE VIEW view_simpatizante_ine AS 
SELECT 
simpine_id, 
CONCAT(simpine_nombre,' ', simpine_apaterno,' ', simpine_amaterno) AS simpine_nombre_completo, 
simpine_seccion, 
simpine_comentario,
simpine_fecha_movimiento
FROM simpatizante_ine
WHERE simpine_visible=1;

